import React from "react";
import s from "./PopularGame.module.css";
import poe from "../../../assets/images/popular-poe.png";
import { Redirect } from "../../../utils/redirect";
import { useTranslation } from "react-i18next";

const PopularGame = () => {
  const { t } = useTranslation();

  return (
    <div className={s.popular} onClick={() => Redirect(props.game, t("game.currentPlace.store"))}>
      <div className={s.content}>
        <div className={s.title}>Path of Exile</div>
        <div className={s.text}>
          New league Expedition is coming! Release on Jul 23!
        </div>
        <div className={s.btn}>
          <a>Play free!</a>
        </div>
      </div>
      <div className={s.image}>
        <img src={poe} />
      </div>
    </div>
  );
};

export default PopularGame;
